import React from 'react'
import TemperatureGraph from "./TemperatureGraphic/TemperatureGraph.js"

class Info extends React.Component {
    constructor(props){
      super(props)
    }

    render() {
        const numOfCities = this.props.data.selectedCities.length > 2 
        return(
            <div>
                {numOfCities ? (
                    <TemperatureGraph data={this.props.data}/>
                ) : (
                    null
                )}   
            </div>
        )
    }
}
export default Info
